import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";

import PokemonAbilities from "./Components/PokemonAbilites";
import HomePage from "./Components/HomePage";
import { Box, Card, Typography, CardContent } from "@mui/material";

function App() {
  const [name, setName] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("http://localhost:5001/pokemon/");
      setName(response.data.data);
    };
    fetchData();
  }, []);
  return (
    <div className="App">
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          padding: "20px",
        }}
      >
        <Card sx={{ borderRadius: "8px", boxShadow: 3, marginBottom: "20px" }}>
          <CardContent>
            <Typography variant="h6" component="div">
              {name?.map((i, index) => (
                <div key={index}>
                  <PokemonAbilities pokemonName={i.name} />
                  <HomePage pokemonName={i.name} />
                </div>
              ))}
            </Typography>
          </CardContent>
        </Card>
      </Box>
    </div>
  );
}
export default App;
